"use strict";(self.webpackChunkmickael_blog=self.webpackChunkmickael_blog||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/presentation-remick","metadata":{"permalink":"/blog/presentation-remick","source":"@site/blog/presentation-remick.md","title":"Pr\xe9sentation Remick","description":"1 - Objectif","date":"2023-09-30T00:00:00.000Z","formattedDate":"30 septembre 2023","tags":[],"readingTime":1.22,"hasTruncateMarker":false,"authors":[{"name":"Micka\xebl C\xe9raline"}],"frontMatter":{"title":"Pr\xe9sentation Remick","author":"Micka\xebl C\xe9raline","date":"2023-09-30T00:00:00.000Z"}},"content":"## 1 - Objectif\\r\\n\\r\\n<p class=\\"mc-p\\">Je suis heureux de vous pr\xe9senter mon nouveau projet, Remick. Dans les prochains jours, je travaillerai activement sur ce projet et partagerai avec vous les d\xe9tails de son d\xe9veloppement \xe0 travers une s\xe9rie d\'articles.</p>\\r\\n\\r\\n<p class=\\"mc-p\\">Remick vise \xe0 simplifier la gestion des biens immobiliers pour les propri\xe9taires. Il s\'agit d\'une application web qui permettra aux propri\xe9taires de pr\xe9lever les loyers de leurs locataires et d\'envoyer les quittances de mani\xe8re enti\xe8rement automatis\xe9e.</p>\\r\\n\\r\\n## 2 - Inspiration\\r\\n\\r\\n<p class=\\"mc-p\\">L\'id\xe9e derri\xe8re Remick d\xe9coule d\'une exp\xe9rience personnelle au sein de notre entreprise familiale sp\xe9cialis\xe9e dans l\'immobilier. Nous avons constat\xe9 la n\xe9cessit\xe9 de simplifier le processus de gestion des loyers et des quittances, actuellement g\xe9r\xe9 manuellement avec l\'aide de l\'outil Rentila.</p>\\r\\n\\r\\n<p class=\\"mc-p\\">Mes motivations pour ce projet sont doubles :</p>\\r\\n\\r\\n<ol>\\r\\n  <li class=\\"mc-p\\">Simplifier et automatiser une t\xe2che fastidieuse tout en mettant en pratique mes comp\xe9tences en d\xe9veloppement web.</li>\\r\\n  <li class=\\"mc-p\\">Accro\xeetre ma visibilit\xe9 en tant que d\xe9veloppeur web pour d\xe9crocher des contrats de d\xe9veloppement int\xe9ressants.</li>\\r\\n</ol>\\r\\n\\r\\n## 3 - M\xe9thodologie\\r\\n\\r\\n<p class=\\"mc-p\\">Le d\xe9veloppement de Remick fera appel aux technologies suivantes :</p>\\r\\n\\r\\n<ul>\\r\\n  <li class=\\"mc-p\\">Front-end :\\r\\n    <ul>\\r\\n      <li class=\\"mc-p\\">JavaScript</li>\\r\\n      <li class=\\"mc-p\\">HTML5</li>\\r\\n      <li class=\\"mc-p\\">React</li>\\r\\n      <li class=\\"mc-p\\">CSS3</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n  <li class=\\"mc-p\\">Back-end :\\r\\n    <ul>\\r\\n      <li class=\\"mc-p\\">C# / .NET</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n  <li class=\\"mc-p\\">Base de donn\xe9es :\\r\\n    <ul>\\r\\n      <li class=\\"mc-p\\">Azure CosmosDB</li>\\r\\n    </ul>\\r\\n  </li>\\r\\n</ul>\\r\\n\\r\\n## 4 - \xc0 venir\\r\\n\\r\\n<p class=\\"mc-p\\">Je commencerai par la phase de planification et de conception. La semaine prochaine, je vous pr\xe9senterai en d\xe9tail l\'architecture de Remick.</p>"}]}')}}]);